INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アヤネ", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 102301, 2, 0.0, 24001, 401, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アヤネ", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2.21, 102301, 2, 0.0, 24002, 402, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アヤネ", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 102301, 2, 0.0, 24003, 403, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アサヒ", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 1.99, 192201, 1, 0.0, 24004, 701, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アサヒ", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2.21, 192201, 2, 0.0, 24005, 702, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アサヒ", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3.33, 192201, 1, 0.0, 24006, 703, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "部員３", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192301, 2, 0.0, 24007, 801, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "部員３", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2.68, 192301, 2, 0.0, 24008, 802, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "部員３", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192301, 2, 0.0, 24009, 803, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "", "やった！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192501, 1, 0.0, 24010, 501, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "", "勝ったよ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192501, 1, 0.0, 24011, 502, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "", "いい調子！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192501, 1, 0.0, 24012, 503, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ミサト", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 5.33, 113501, 2, 0.0, 24013, 111, 6);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ミサト", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 6.85, 113501, 2, 0.0, 24014, 112, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ミサト", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3.0, 113501, 2, 0.0, 24015, 113, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ダイチ", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 6.11, 192401, 2, 0.0, 24016, 611, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ダイチ", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 6.75, 192401, 2, 0.0, 24017, 612, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ダイチ", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192401, 2, 0.0, 24018, 613, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ハツネ", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 4.52, 113401, 1, 0.0, 24019, 211, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ハツネ", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3.89, 113401, 1, 0.0, 24020, 212, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "ハツネ", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 13.49, 113401, 2, 0.0, 24021, 213, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "カヤ", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3.17, 106501, 2, 0.0, 24022, 311, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "カヤ", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 4.42, 106501, 2, 0.0, 24023, 312, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "カヤ", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 2.89, 106501, 1, 0.0, 24024, 313, 6);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アヤネ", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 3.71, 102301, 3, 0.0, 24025, 421, 4);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "アサヒ", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 5.1, 192201, 1, 0.0, 24026, 721, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "部員３", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 4.34, 192301, 3, 0.0, 24027, 821, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, 0.0, "", "いい勝負だったよ\nまたやろうね", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 192501, 1, 0.0, 24028, 521, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, -360.0, "ミサト", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 5.62, 113501, 2, 0.0, 24029, 101, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, -360.0, "ミサト", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 9.58, 113501, 2, 0.0, 24030, 102, 1);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, -360.0, "ミサト", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 113501, 2, 0.0, 24031, 103, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, -360.0, "ミサト", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 9.13, 113501, 1, 0.0, 24032, 104, 2);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES (10046, -360.0, "ミサト", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 8.27, 113501, 2, 0.0, 24033, 105, 1);
